import './App.css'
import { Link, Route } from 'wouter'
import Home from './pages/Home';
import SearchResults from './pages/SearchResults';
import Pepito from './Hooks/StaticContext';
import Details from './pages/Details';
import { GifsContextProvider } from './Hooks/GifsContext';

export default function App() {
  return (
    <Pepito.Provider value={{name: 'Midudev', suscribeteAlCanal: true}}>
      <div className="App">
        <section className="App-content">
          <GifsContextProvider>
          <Link to='/'><h1>App</h1></Link>

            <Route component={Home} path='/' />
            <Route component={SearchResults} path='/search/:keyword' />
            <Route component={Details} path='/gif/:id' /> 
          </GifsContextProvider>
        </section>
      </div>
    </Pepito.Provider>
  );
}
